import React from "react";

function generateMapLink(address) {
    // Encode the address to make sure it's properly formatted for URL
    const encodedAddress = encodeURIComponent(address.trim());

    // Construct the Google Maps URL
    const mapLink = `https://www.google.com/maps/search/?api=1&query=${encodedAddress}`;

    return mapLink;
}

// Example usage:
const address = "1600 Amphitheatre Parkway, Mountain View, CA";
const mapUrl = generateMapLink(address);
